import React from 'react';

function add(a,b){
    let d=a+b;
    return d;
}
export {add};


function sub(a,b){
    let d=a-b;
    return d;
}
export {sub};


function div(a,b){
    let d=a/b;
    return d;
}
export {div};


function multiply(a,b){
    let d=a*b;
    return d;
}
export {};
